[mod-setting-description]
TS_base_shield=启动容量增长率 (50 - [200] - 10000)
TS_base_charge_rate=启动充电效率 (1 - [20] - 1000)
TS_research_enabled=必须通过研究获得盾牌科技\n可以自由开关
TS_research_size=护盾容量每个级别增长率 (100 - [5] - 1).
TS_research_speed=护盾充电效率每个级别增长率 (100 - [5] - 1).
TS_alternate_effect=将炮台护盾的视觉效果替换成另一个版本。（翻译注：原版是另一个MOD作者的版本）
TS_energy_consumption=护盾充能需要电力
TS_energy_consumption_multiplier=你可以在这里设置每单位护盾能量需要的电力乘数 1 = 1KJ/hitpoint. \n(0.01 - [25.00] - 100.0)
TS_penalty=当护盾能量用尽，充电每秒百分比。
TS_power_drain=此处的1表示10K护盾值，每个护盾值消耗100KW电 (0.1 - [10] - 50)
TS_max_research_level=有助于减轻由于“已达到实体ID限制”而导致的启动失败。这里的值100表示100^2或者10000个实体。 异星工厂有65536个实体定义的限制 (5 - [25] - 100)

